import React from 'react'
import { Card, Col, Button, CardImg } from 'react-bootstrap'

const Bebida = ({bebida}) => {
  return (
      
      <Col md={2} lg={4}>
          <Card className='mb-4'>
             <CardImg
               variant='top'
               src={bebida.strDrinkThumb}
             />
          </Card>
      </Col>

  )
}

export default Bebida
